import React, { useState, useEffect } from 'react';
import {
  Box, ButtonGroup, Button, Heading, HStack, Flex, Image, Stack, Text, Input, InputGroup, Avatar, Textarea,
  Step, StepDescription, StepIcon, StepIndicator, StepNumber, StepSeparator, StepStatus, StepTitle, Stepper, useSteps, useColorModeValue,
} from '@chakra-ui/react';
import { useRecoilState } from 'recoil';
import { formDataState, fetchedDataState } from '../../components/recoilAtoms';
import Form1 from './form1';
import Form2 from './form2';
import Form3 from './form3';
import jsPDF from 'jspdf'


const steps = [
  { title: 'Customer', description: 'Contact Details' },
  { title: 'Model', description: 'Vehicle Selection' },
  { title: 'Confirmation', description: 'Finance' },
];

export default function Switch() {

   // ------- print pdf --------
   function ModifyPdf() {

    const doc = new jsPDF();
  // base sheet

    const img = 'data:image/jpeg;base64,'
    
    var width = doc.internal.pageSize.getWidth()
    var height = doc.internal.pageSize.getHeight()
    doc.addImage(img, 'JPEG', 0, 0, width, height);
  
    // Set the font size and text alignment for form field values
    doc.setFontSize(9);
  
    // Fill in the form field values
    doc.text(42, 53, `${formData.name}`); // Name field
    doc.text( 134, 53, `${formData.phone}`); // Phone field
    doc.text( 121, 60, `${formData.email}`); // Email field
    doc.text( 29, 70, `${formData.address}`); // Address field
   
    doc.text( 21, 95, `${fetchedData.model1}`); // Accessories field
    doc.text( 51, 117, `${fetchedData.modelCode}`); // Accessories field
    doc.text( 21, 103, `${fetchedData.color}`); // Accessories field
 
    doc.text( 32, 87, `${formData.stockNum}`); // StockNum field
    doc.text( 14, 166, `${formData.trade}`); // Trade field
    doc.text( 14, 174, `${formData.deposit}`); // Deposit field
    doc.text( 14, 181, `${formData.options}`); // Accessories field
    doc.text( 118, 92, `${fetchedData.msrp}`); // Accessories field
  
    // Save the filled PDF document
    doc.save((`${formData.name}.pdf`));
  };

  //-----------
  const [step, setStep] = useState(1);
  const [progress, setProgress] = useState(0);
  const [formData, setFormData] = useRecoilState(formDataState);
  const [fetchedData, setFetchedData] = useRecoilState(fetchedDataState);

  useEffect(() => {
    if (formData.model) {
      fetchData();
    }
  }, [formData.model]);

  const handleBack = () => {
    setStep(step - 1);
    setProgress(progress - 33.33);
  };

  const handleNext = () => {
    if (step === 3) {
      // Navigate to the CanAm2 page
    } else {
      setStep(step + 1);
      setProgress(progress + 33.33);
      if (step === 2) {
        fetchData();
      }
    }
  };

  const { activeStep } = useSteps({
    index: step - 1, // Adjust the index to match the step
    count: 3, // Total number of steps
  });

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: value,
    }));
  };

  const fetchData = () => {
    fetch(`http://localhost:3000/api/models/${formData.model}`)
      .then((response) => response.json())
      .then((data) => {
        setFetchedData(data);
      })
      .catch((error) => {
        console.error('Error:', error.message);
      });
  };

  console.log(formData);
  console.log(fetchedData);
  return (
    <>
<form>
      <Box borderWidth="1px"
        rounded="lg"
        shadow="1px 1px 3px rgba(0,0,0,0.3)"
        maxWidth={800}
        p={6}
        m="10px auto"
        as="form">
        <Stepper size="lg" index={activeStep}>
          {steps.map((step, index) => (
            <Step key={index}>
              <StepIndicator>
                <StepStatus
                  complete={<StepIcon />}
                  incomplete={<StepNumber />}
                  active={<StepNumber />}
                />
              </StepIndicator>

              <Box flexShrink="0">
                <StepTitle>{step.title}</StepTitle>
                <StepDescription>{step.description}</StepDescription>
              </Box>

              <StepSeparator />
            </Step>
          ))}
        </Stepper>
        {step === 1 ? <Form1 /> : step === 2 ? <Form2 /> : <Form3 />}
        <ButtonGroup mt="5%" w="100%">
          <Flex w="100%" justifyContent="space-between">
            <Flex>
              <Button
                onClick={handleBack}
                isDisabled={step === 1}
                colorScheme="teal"
                variant="solid"
                w="7rem"
                mr="5%">
                Back
              </Button>
              <Button
                w="7rem"
                isDisabled={step === 3}
                onClick={handleNext}

                colorScheme="teal"
                variant="outline">
                Next
              </Button>
            </Flex>
            {step === 3 ? (
              <Button
                w="7rem"
                colorScheme="red"
                variant="solid"
             onClick={ModifyPdf}
              >
                Print
              </Button>
            ) : null}
          </Flex>
        </ButtonGroup>
      </Box>

      <Box w="100%" textAlign={'center'} fontWeight="normal" mb="2%"
        borderWidth="1px"
        rounded="lg"
        shadow="1px 1px 3px rgba(0,0,0,0.3)"
        maxWidth={800}
        p={6}
        m="10px auto"
        as="form">

        <HStack spacing={6}>

          <Box w="100%" h="100%"
            bg={useColorModeValue('white', 'gray.800')}
            boxShadow={'2xl'}
            rounded={'md'}
            overflow={'hidden'}>
            <Image
              h={'120px'}
              w={'full'}
              src={
                'https://www.sea-doo.com/content/dam/global/en/sea-doo/my22/lifestyle/SEA-MY22-SPORT-13-170-ACE-Caribbean-Blue-Action.000567-RGB.jpg'
              }
              objectFit={'cover'}
            />
            <Flex justify={'center'} mt={-12}>
              <Avatar
                size={'xl'}
                src={
                  'https://images.unsplash.com/photo-1500648767791-00dcc994a43e?ixlib=rb-1.2.1&q=80&fm=jpg&crop=faces&fit=crop&h=200&w=200&ixid=eyJhcHBfaWQiOjE3Nzg0fQ'
                }
                alt={'Author'}
                css={{
                  border: '2px solid white',
                }}
              />
            </Flex>

            <Box p={6}>
              <Stack spacing={0} align={'center'} mb={5}>
                <Heading fontSize={'2xl'} fontWeight={500} fontFamily={'body'}>

                </Heading>
                <Text color={'gray.500'}>{formData.name}</Text>
              </Stack>

              <Text color={'gray.500'}>Phone: {formData.phone}</Text>
              <Text color={'gray.500'}>Email: {formData.email}</Text>
              <Text color={'gray.500'}>Address: {formData.address}</Text>
            </Box>
          </Box>
          <Box
            w="100%"
            height="100%"
            bg={useColorModeValue('white', 'gray.800')}
            boxShadow={'2xl'}
            rounded={'md'}
            overflow={'hidden'}>
            <Image
              h={'120px'}
              w={'full'}
              src={
                'https://www.sea-doo.com/content/dam/global/en/sea-doo/my23/lifestyle/SEA-MY23-Switch-Sport-1630ACE170-CARRIBBEANBLUE-Action-Manta13-002964-RGB-4096x2304.jpg'
              }
              objectFit={'cover'}
            />
            <Box p={6}>
              <Stack spacing={0} align={'center'} mb={5}>
                <Heading fontSize={'2xl'} fontWeight={500} fontFamily={'body'}>

                </Heading>
                <Text color={'gray.500'}>  {formData.model}</Text>
              </Stack>
              <Text color={'gray.500'}>Stock Number: {formData.stockNum}</Text>
              <Text color={'gray.500'}>Year: {formData.year}</Text>
              <Text color={'gray.500'}>Trade: {formData.trade}</Text>
              <Text color={'gray.500'}>Deposit: {formData.deposit}</Text>
              <Text color={'gray.500'}>Labour Hours: {formData.options}</Text>
              <Text color={'gray.500'}>Trade: {formData.trade}</Text>
            </Box>
          </Box>
        </HStack>
      </Box>
      </form>
    </>
  );
}